import logo from './logo.svg';
import './App.css';
import {useState} from "react";

const TIME_LIMIT = 10;
function App() {
  const [time, setTime] = useState(TIME_LIMIT)
  function startGame(){
    setTime
  }
  return (
    <div className="App">
      <header className="App-header">
        <h1>{time}</h1>
        <img src={logo} className="App-logo" alt="logo" />
        <button onClick={startGame}>start</button>
      </header>
    </div>
  );
}

export default App;
